import React from 'react';

const Project = (props) => {
    return (
        <div>
              {/* DinMo Project 1 */}
              <figure class="col-sm-12 col-md-6 col-lg-12 col-xl-6" style="position:relative">
                <h5 class="project-title">{props.title}</h5>
                <img class="img-fluid" src={props.image} alt={props.title}/>
                <a  class="centered-link left-float" target="_blank" href={props.deployedlink}>Deployed Website</a>
              
                <a class="centered-link right-float" target="_blank" href="https://github.com/Chayvw/gt-gp1-dinmo">GitHub Repository</a>
              </figure> 
        </div>
    );
};

export default Project;
